import React from "react"

// to pass data from one component to another we use -->>> Props
const ImageList = (props) => {
    console.log(props)
    return (
        
        <div>{/* ES6 destructoring to get rid of the key (do not need images no more)*/}
            {  
                props.images.map(({ id, tags}) => {
                    return <p key={id}>{tags} </p>
                }
            )}
            </div>
        )
}


export default ImageList
